import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import NavBarTop from "./components/navBarTop";

const router = createBrowserRouter([
  {
    path: "/",
    element: {Home},
  },
]);
function App() {
  return (

    <Router>
      <NavBarTop />
      <Switch>
        <Route path="/" exact element={Home} />
      </Switch>
    </Router>
    // <div className="App">
    //   <Home />
    // </div>
  );
}

export default App;
